import React, { useState } from 'react'

export default function UserView({ r }) {

    const [node, setNode] = useState(false)

    const nodeClick = () => {
        setNode(!node)
    }

    const nodes = r.nodes.map((n => {
        return <li key={n}>
            {Object.keys(n)}
        </li>
    }))

  return (
    <li className='user-view'>
        <div>
            Name: {r.name}
        </div>
        <div>
            E-mail: {r.email}
        </div>
        <button onClick={nodeClick}>Check Nodes</button>
        {/* {r.nodes} */}
        {node ? <>
            <ol>
                {nodes}
            </ol>
        </>:<></>}
    </li>
  )
}
